MongoDB Aggregation for every 10 weeks between week 1 2021 (including) and week 45 2021 (excluding)<p>Let us say for example I have a collection which contains car sales information for a manufacturer worldwide.</p>
<pre><code>Timeline     Country    Sales
2021-W01       A          10
2021-W02       B          20
2021-W03       C          30

2022-W33       Z          50
</code></pre>
<p>Now I would like the aggregation to compute total sales for every 10 weeks between week 1 2021 (including) and week 45 2021 (excluding).</p>
<p>Desired Output:</p>
<pre><code>{
    &quot;result&quot;: [
        {
            &quot;start&quot;: &quot;2021-W01&quot;,
            &quot;end&quot;: &quot;2021-W10&quot;,
            &quot;totalSales&quot;: 100
        },
        {
            &quot;start&quot;: &quot;2021-W10&quot;,
            &quot;end&quot;: &quot;2021-W20&quot;,
            &quot;totalSales&quot;: 20
        },

        {
            &quot;start&quot;: &quot;2021-W40&quot;,
            &quot;end&quot;: &quot;2021-W45&quot;,
            &quot;totalSales&quot;: 1
        }
    ]
}
</code></pre>
<p>For this so far, I have come up with this solution.</p>
<pre><code>db.collection.aggregate([
    {&quot;$match&quot;: {&quot;$and&quot;:[{&quot;Country&quot;: &quot;A&quot;}, {&quot;Timeline&quot;: {&quot;$in&quot;: [2021-W01, 2021-W11,  2021-W45]}}]}},
    {&quot;$group&quot;: {&quot;_id&quot;: {Timeline: &quot;$Timeline&quot;, totalSales: {&quot;$sum&quot;: &quot;$Sales&quot;}}}},
    {&quot;$project&quot;: {&quot;_id&quot;: 0, result: &quot;$_id&quot;}}
])
</code></pre>
<p>But this is producing output like this</p>
<pre><code>[
    {
        &quot;result&quot;: {
            &quot;Timeline&quot;: &quot;2021-W01&quot;,
            &quot;totalSales&quot;: 10
        }
    },
    {
        &quot;result&quot;: {
            &quot;Timeline&quot;: &quot;2021-W02&quot;,
            &quot;totalSales&quot;: 20
        }
    },

    {
    &quot;result&quot;: {
            &quot;Timeline&quot;: &quot;2021-W45&quot;,
            &quot;totalSales&quot;: 23
        }
    }
]
</code></pre>
<p>I am unable to get aggregated results for every 10 weeks as this is only doing it for every week.
If possible, I kindly request everyone to help me understand this. Thanks.</p>
<p><strong>Additional Information:</strong> (Requested by @WernfriedDomscheit)</p>
<ol>
<li><p>Is the timeline according to ISO-8601? (Note, actual year might be different to ISO-Week)</p>
<p>Yes, it is. Only weeks are allowed(For example &quot;2022-W34&quot;).
(yyyy-Www format)</p>
</li>
<li><p>Sample Input</p>
</li>
</ol>
<pre><code>    {
      &quot;records&quot;: [{
          &quot;Timeline&quot;: &quot;2021-W01&quot;,
          &quot;Sales&quot;: 10,
          &quot;Country&quot;: &quot;A&quot;
       }, {
          &quot;Timeline&quot;: &quot;2021-W02&quot;,
          &quot;Sales&quot;: 11,
          &quot;Country&quot;: &quot;A&quot;
       }, {
          &quot;Timeline&quot;: &quot;2021-W03&quot;,
          &quot;Sales&quot;: 12,
          &quot;Country&quot;: &quot;A&quot;
       }, {
          &quot;Timeline&quot;: &quot;2021-W04&quot;,
          &quot;Sales&quot;: 13,
          &quot;Country&quot;: &quot;A&quot;
       }]
    }
</code></pre>
<ol start="3">
<li>Expected Output</li>
</ol>
<pre><code>{
    &quot;result&quot;: [{
        &quot;start&quot;: &quot;2021-W01&quot;,
        &quot;end&quot;: &quot;2021-W03&quot;,
        &quot;totalSales&quot;: 21
    }, {
        &quot;start&quot;: &quot;2021-W03&quot;,
        &quot;end&quot;: &quot;2021-W04&quot;,
        &quot;totalSales&quot;: 12
    }]
}
</code></pre>
<p>Explanation for desired output:</p>
<p>Let's assume we want the aggregate the total sales for 2 weeks between 2021-W01(including) and 2021-W04 (excluding).</p>
<ul>
<li>Add week1 sales and week2 sales =&gt; 10 + 11 =&gt; 21
( startweek: 2021-W01 (including) and endweek 2021-W03 (excluding) ).</li>
<li>Take week3 sales only =&gt; 12
( startweek: 2021-W03 (including) and endweek 2021-W04 (excluding) ).</li>
</ul>
<ol start="4">
<li><p>Where does 2021-W01 and 2021-W45 come from? Static input values or based on collection data. Why 1-10, 10-20, 20-30, 30-40, 40-45 (and not 40-50) ?.</p>
<p>It is a collection data. For the last result, it is 40-45 and not 40-50 because I mentioned that we need to compute total sales for every 10 weeks between week 1 2021 (including) and week 45 2021 (excluding). So even if the collection has data till 2022-W04 we stop at week 45 2021 (excluding). This means the last result will only aggregate for the 2021-W40 - 2021-W44 range.</p>
</li>
<li><p>Do you have always at least one entry per week?</p>
<p>No. Certain countries may have missed feeding the data for a week.</p>
</li>
</ol>

